Sunny makes a surprise stop at the home of her old college roommate, Michelle, but finds that she isn't home. However, Michelle's husband, Tommy, is. He invites Sunny in to talk, but he soon finds out that her conversational style is very touchy-feely ... literally. Tommy gets to know his wife's old roommate and her sexy body real well, and turns her pop-in into a, well, pop-in-and-out.
